class App extends React.Component {


    pokemonCall3(pokemonId2) {
        pokemonId = pokemonId2
        console.log("aa"+pokemonId)

        //this.props.pokemonid = pokemonId;  

    }

    area = (xCoor,yCoor) => {
        x = xCoor;
        y = yCoor;
    }


    render() {
        return (
            <div className="row">
                <div className="col-6">
                    <Map 
                    x = {x ? x : 51.505}
                    y = {y ? y : -0.09}


                    />

                </div>
                <div className="col-6">
                    <Toolbox 
                    area={this.area}
                    pokemonCall2={this.pokemonCall3} />

                </div>
            </div>
        );
    }

};
export default App;
